def bestQuiz(l):
      
      c=0
      z=0
      
      results =[]
    

      for i in range (len(l[0])):
            d=0
            Range=0
            count=0
            for j in range (len(l)):
                  if l[j][i]==-1:
                        count+=0
                        
                        Range+=-1
                  else:
                        count+=l[j][i]
                        Range+=1
            if Range<=0:
                  d=count
            else:
                  d=count//Range
            results.append(d)
      x=max(results)
      
      if x!=0:
          return results.index(x)
      else:
          return None
